import createReactComponent from "../createReactComponent";
import defaultAttributes from "../defaultAttributes";
var Voicemail = createReactComponent("Voicemail", ["svg", defaultAttributes, [["circle", {
  cx: "5.5",
  cy: "11.5",
  r: "4.5",
  key: "1dtq6q"
}], ["circle", {
  cx: "18.5",
  cy: "11.5",
  r: "4.5",
  key: "1ymvvr"
}], ["line", {
  x1: "5.5",
  y1: "16",
  x2: "18.5",
  y2: "16",
  key: "1dc5s6"
}]]]);
export default Voicemail;
